import { makeStyles } from "@material-ui/core";

export const useStyles = makeStyles({
  root: {
    height: 300,
    flexGrow: 1,
    padding: "0 24px",
    maxWidth: "100%",
  },
  broot: {
    maxWidth: "100%",
  },
  media: {
    height: 140,
  },
});
